    vector<double> getInputVector(std::vector<std::vector<double>> img1, std::vector<std::vector<double>> img2, int time_step)
    {
        vector<double> iVector;
        int start_index = (7) * (time_step);
        for (int i = 0; i < 5; i++)
        {
            iVector.push_back(img1[0][start_index + i]); //first element of each row
        }
        for (int i = 0; i < 5; i++)
        {
            iVector.push_back(img2[0][start_index + i]); //first element of each row
        }

        iVector.push_back(-1.0);

        return iVector;
    }

    vector<std::string> split(std::string text, char delim)
    {
        std::string line;
        std::vector<std::string> vec;
        std::stringstream ss(text);
        while (std::getline(ss, line, delim))
        {
            vec.push_back(line);
        }
        ss.clear();
        return vec;
    }

    vector<std::vector<double>> readCSV(string fileName)
    {
        ifstream file(fileName);
        vector<std::vector<double>> dataList;
        string s = "";
        // Iterate through each line and split the content using delimeter

        while (getline(file, s))
        {
            vector<double> doubleArray;
            vector<std::string> vstrings = split(s, ' ');

            for (int i = 0; i < vstrings.size(); i++)
            {
                string a = vstrings[i];
                doubleArray.push_back(atof(a.c_str())); //stod doesn't work. This is the best solution possible.
                //update stackoverflow on solution above.
            }
            dataList.push_back(doubleArray);
        }

        // Close the File
        file.close();
        return dataList;
    }


    void UpdateHiddenUVVector(vector<double> &U,vector<double> &V, double lambda_s,double lambda_l,double, vector<double> outputs,vector<double> outputs_tilde,vector<double> outputs_bar,vector<double> outputs_tilde_old,vector<double> outputs_bar_old,vector<double> outputs_old)
    {
        int current_index;
        int hidden_start_index = 11;
        for(int j=0;j<10;j++)
        {
            current_index = hidden_start_index + j;
         //   U_hidden[j] += (output_tilde-output) * (lambda_s * hidden_output_tilde_old[j] + (1.0 - lambda_s)*hidden_output_old[j] - hidden_output_new[j]);
            U[current_index] += (outputs_tilde.back() - outputs.back()) * (lambda_s * outputs_tilde_old[hidden_start_index + j] + (1.0 - lambda_s) * outputs_old[current_index] - outputs[current_index]);
            V[current_index] += (outputs_bar.back() - outputs.back()) * (lambda_l * outputs_bar_old[hidden_start_index + j] + (1.0 - lambda_l) * outputs_old[current_index] - outputs[current_index]);
        }
    }


